import { isNull } from "@tsparticles/engine";
export class TextMaskLine {
    constructor() {
        this.separator = "\n";
        this.spacing = 10;
    }
    load(data) {
        if (isNull(data)) {
            return;
        }
        if (data.separator !== undefined) {
            this.separator = data.separator;
        }
        if (data.spacing !== undefined) {
            this.spacing = data.spacing;
        }
    }
}
